import React from "react"

import StepDescription from "./StepDescription"


export default class DescriptionPane extends React.Component {
    constructor(props) {
        super(props);
        this.counter = 0;
    }

    render() {
        var descriptions = [{key: 0, mode: "unselected", level: 1}];
        var descriptionList = descriptions.map((item) => <StepDescription key={item.key} mode={item.mode} level={item.level}/>)

        return {descriptionList}

    }
}
